import React from 'react'

const HeroContent = () => {
  return (
    <>
    <h1>Welcome to Estendo</h1>
    <p>Your one-stop shop for all information about your favorite generator and water pump brands, your trusted dealer network in Sumec and other generator brands for over 20 years.</p>
    <button className="my-btn btn btn-danger mr-2">Select a Generator</button>
    <button className="btn btn-outline-light">Generator Advice</button>
    </>
  )
}

export default HeroContent
